The British

History Documentary hosted by Ioan Gruffudd, published by BSkyB in 2012 - English narration


Information
------------------------------

The British
2,000 years of British history will be told in epic scale, The British tells the history of Britain and Ireland from the Roman invasion to the birth of TV and the Coronation of Elizabeth II in 1953. Spanning two thousand years in seven hours, the series will bring vividly to life through compelling drama and spectacular CGI the real and often surprising stories of the unsung heroes as well as the icons of history. A line-up of notable and influential celebrities will give their views on what the history of Great Britain means to them. The list of celebrities contributing to the show includes: Russell Brand, Lily Cole, Tracey Emin, Helen Mirren, Caitlin Moran, Lord Puttnam, Ben Kingsley and Robert Winston.



4)  Dirty Money 
How money drove the making of modern Britain, exploring its role in the rebuilding of London following the Great Fire of 1666. The programme investigates how underhanded deals brokered in coffee houses fuelled British prosperity, and exposes how the country profited from dubious practices, including the slave trade, the sex industry and global colonisation. It also explores those who rebelled against the status quo during the period, and discovers how the armed forces countered the threat posed by Napoleon Bonaparte.



